  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115226 includes chemical,
  meteorological, physical and underway - surface data collected from Atlantic Companion
  in the Inner Sea - West Coast Scotland, Irish Sea and St. George's Channel and North
  Atlantic Ocean from 2006-06-11 to 2007-11-05 and retrieved during cruise 77CN20060611.
  These data include BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, Partial pressure (or
  fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE. The instruments
  used to collect these data include Barometric pressure sensor, Carbon dioxide (CO2)
  gas analyzer, Shower head chamber equilibrator for autonomous carbon dioxide (CO2)
  measurement and thermosalinographs. These data were collected by Tobias Steinhoff
  and Arne Koertzinger of Leibniz Institut Fur Meereswissenschaften and Douglas Wallace
  of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich Marine Biogeochemie
  as part of the VOS_Atlantic_Companion_Line_2006_2007 data set.nnThe Global Volunteer
  Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
  Coordination Project (IOCCP). International groups from 14 countries have been outfitting
  research ships and commercial vessels with automated CO2 sampling equipment to analyze
  the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
